import React, { useState } from 'react';
import { useCapTable } from '../../hooks/useCapTable';
import CapTableContent from './components/captable/CapTableContent';
import RoundHistory from './components/roundhistory/RoundHistory';
import ExitScenarios from './components/exitscenarios/ExitScenarios';
import InvestmentPlanning from './components/investment/InvestmentPlanning';
import ShareholderTable from './components/shareholders/ShareholderTable';
import OwnershipVisualization from './components/visualization/OwnershipVisualization';
import AddShareClassForm from './components/captable/AddShareClassForm';
import { Dialog } from '@headlessui/react';
import Modal from '../../common/Modal';

const CapTable = ({ activeSubTab, onSubTabChange }) => {
  const {
    loading,
    error,
    capTable,
    rounds,
    shareholders,
    shareClasses,
    transactions,
    preferenceTerms,
    loadData,
    loadCapTableAtRound,
    calculateExitScenario,
    addRound,
    updateRound,
    deleteRound,
    addTransaction,
    updateTransaction,
    deleteTransaction,
    addShareholder,
    updateShareholder,
    deleteShareholder,
    addShareClass,
  } = useCapTable();

  const [isAddShareholderModalOpen, setAddShareholderModalOpen] = useState(false);
  const [isAddShareClassModalOpen, setAddShareClassModalOpen] = useState(false);
  const [isAddRoundModalOpen, setAddRoundModalOpen] = useState(false);

  const handleAddShareClass = async (shareClassData) => {
    await addShareClass(shareClassData);
    setAddShareClassModalOpen(false);
  };

  const handleAddRound = async (roundData) => {
    // ... existing code ...
  };

  const renderContent = () => {
    if (loading) {
      return (
        <div className="flex items-center justify-center h-64">
          <div className="animate-spin rounded-full h-8 w-8 border-b-2 border-blue-600"></div>
        </div>
      );
    }

    if (error) {
      return (
        <div className="bg-red-50 border border-red-200 rounded-md p-4">
          <div className="flex">
            <div className="ml-3">
              <h3 className="text-sm font-medium text-red-800">Error loading cap table data</h3>
              <div className="mt-2 text-sm text-red-700">
                <p>{error}</p>
              </div>
            </div>
          </div>
        </div>
      );
    }

    switch (activeSubTab) {
      case 'captable':
        return (
          <CapTableContent 
            capTable={capTable}
            rounds={rounds}
            shareholders={shareholders}
            shareClasses={shareClasses}
            onRoundChange={loadCapTableAtRound}
            onRefresh={loadData}
          />
        );
      case 'round-history':
        return (
          <RoundHistory 
            rounds={rounds}
            transactions={transactions}
            shareholders={shareholders}
            onAddRound={addRound}
            onUpdateRound={updateRound}
            onDeleteRound={deleteRound}
            onAddTransaction={addTransaction}
            onUpdateTransaction={updateTransaction}
            onDeleteTransaction={deleteTransaction}
            onRefresh={loadData}
          />
        );
      case 'scenarios':
        return (
          <ExitScenarios 
            capTable={capTable}
            preferenceTerms={preferenceTerms}
            onCalculateScenario={calculateExitScenario}
          />
        );
      case 'investment':
        return (
          <InvestmentPlanning 
            capTable={capTable}
            rounds={rounds}
            shareholders={shareholders}
            onAddRound={addRound}
            onRefresh={loadData}
          />
        );
      default:
        return (
          <CapTableContent 
            capTable={capTable}
            rounds={rounds}
            shareholders={shareholders}
            shareClasses={shareClasses}
            onRoundChange={loadCapTableAtRound}
            onRefresh={loadData}
          />
        );
    }
  };

  return (
    <div className="space-y-6">
      {renderContent()}

      <div className="flex items-center justify-end space-x-4">
        <div className="flex items-center space-x-4">
          <button
            type="button"
            onClick={() => setAddShareholderModalOpen(true)}
            className="ml-3 inline-flex items-center px-4 py-2 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500"
          >
            Add Shareholder
          </button>
          <button
            type="button"
            onClick={() => setAddShareClassModalOpen(true)}
            className="ml-3 inline-flex items-center px-4 py-2 border border-gray-300 rounded-md shadow-sm text-sm font-medium text-gray-700 bg-white hover:bg-gray-50 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500"
          >
            Manage Share Classes
          </button>
        </div>
      </div>

      <Modal isOpen={isAddShareholderModalOpen} onClose={() => setAddShareholderModalOpen(false)}>
        {/* Placeholder for AddShareholderForm */}
        <div className="p-4">
          <h3 className="text-lg font-medium">Add New Shareholder</h3>
          <p>Form to add a new shareholder will be here.</p>
        </div>
      </Modal>

      <Modal isOpen={isAddShareClassModalOpen} onClose={() => setAddShareClassModalOpen(false)}>
        <AddShareClassForm
          onAdd={handleAddShareClass}
          onCancel={() => setAddShareClassModalOpen(false)}
        />
      </Modal>

      <Modal isOpen={isAddRoundModalOpen} onClose={() => setAddRoundModalOpen(false)}>
        <div className="p-4">
          <h3 className="text-lg font-medium">Add New Round</h3>
          <p>Form to add a new round will be here.</p>
        </div>
      </Modal>
    </div>
  );
};

export default CapTable;
